                    opacity: 1;
                    }
                    & input.auth_show_err {
                        animation-name: showErr;
                        animation-duration: 1.5s;
                    }
                }
                & p {
                    font-style: normal;
                    font-weight: 500;
                    font-size: 0.8rem;
                    line-height: 100%;
                    opacity: 0.4;
                    margin: 0.2rem 0.2rem 0.2rem 0.1rem;
                }
                & input {
//                    margin-bottom: 0.5rem;
//                    margin: 0.0 0.2rem 0.0 0.0;
                    font-style: normal;
                    font-weight: bold;
                    font-size: 22px;
                    line-height: 100%;
                    text-align: left;
                    color: #FFFFFF;
                    width: 100%;
                    background-color: #00000000;
                    border: 0.0 solid #00000000;
                    &.auth_close_err {
                        animation-name: closeErr;
                        animation-duration: 1.5s;
                    }
                }
                & .auth_pass_area {
                    display: flex;
                    & img.auth_eye_open {
                        animation-name: openEye;
                        animation-duration: 0.8s;
                    }
                    & img.auth_eye_close {
                        animation-name: closeEye;
                        animation-duration: 0.8s;
                    }
                    & img {
                        margin-left: 1rem;
                        cursor: pointer;
                    }
                    & div {
                        width: 100%;
                    }
                }
            }
            & .auth_error_null {
                margin: 0.5rem 1rem;
                height: 5rem;
            }
            & .auth_error_box {
                margin: 0.5rem 1rem;
                border-radius: 0.4rem;
                width: 22rem;
                height: 5rem;
                background: #EB5757;
                opacity: 0.8;
                padding: 1rem;
                display: flex;
                flex-direction: column;
                justify-content: center;
                & p {
                    margin: 0;
                    &:first-child {
                        font-weight: 700;
                    }
                    font-style: normal;
                    font-weight: 400;
                    font-size: 0.8rem;
                    line-height: 120%;
                    color: #FFFFFF;
                }
            }
            & .auth_form_key {
                margin: 0.5rem;
                background: linear-gradient(273.39deg, #E3256B 5.57%, #E3256B 59.24%, #E3256B 94.41%);
                box-shadow: 0px 10px 100px rgba(227, 37, 107, 0.55);
                border-radius: 0.4rem;
                width: 22rem;
                height: 5rem;
                display: flex;
                justify-content: center;
                align-items: center;
                cursor: pointer;
                transition: 0.5s ease-in-out;
                &:hover {
                    box-shadow: 0px 10px 50px rgba(227, 37, 107, 1);
                }
                & p {
                    transition: 1s ease;
                    font-style: normal;
                    font-weight: 700;
                    font-size: 1.3rem;
                    line-height: 100%;
                    text-align: center;
                    text-transform: uppercase;
                    margin: 0;
                }
            }
            & .auth_down {
//                margin: 3.1rem;
                margin: 0.5rem;
                display: flex;
                width: 22rem;
                height: 3rem;
                justify-content: center;
                align-items: center;
                & .auth_goto_reg {
                    background: rgba(255, 255, 255, 0.1);
                    border-radius: 0.4rem;
                    text-align: center;
                    align-self: center;
                    padding: 1.0rem;
                    width: 50%;
                    opacity:1 !important;
                    cursor: pointer;
                    transition: 0.5s ease-in-out;
                    &:hover {
                        background: rgba(255, 255, 255, 0.19);
                    }

                }
                & .auth_goto_rest {
                    text-align: end;
//                    align-self: flex-end;
                    padding: 1.0rem 0.1rem;
                    width: 50%;
                    cursor: pointer;
                }
            }
        }
    }
}


@keyframes openEye {
    0%   { transform: rotate3d(1, 0, 0, 00deg); }
    50%  { transform: rotate3d(1, 0, 0, 90deg); }
    100%   { transform: rotate3d(1, 0, 0, 00deg); }
}
@keyframes closeEye {
    0%  { transform: rotate3d(1, 0, 0, 00deg); }
    50%  { transform: rotate3d(1, 0, 0, 90deg); }
    100%  { transform: rotate3d(1, 0, 0, 00deg);}
}

@keyframes closeErr {
    0%  { opacity: 1; }
    50%  { opacity: 0; }
    100%  { opacity: 1;}
}
@keyframes showErr {
    0%  { opacity: 1; }
    50%  { opacity: 0; }
    100%  { opacity: 1;}
}
